import Link from 'next/Link';

const linkStyle = {
    marginRight: 15
};

const Index = () => (
    <div>
        <h1>Links</h1>
        <Link href="/">
            <a title="Home" style={linkStyle}>Home</a>
        </Link>
        <Link href="/about">
            <a title="About" style={linkStyle}>About</a>
        </Link>

        <p>Hello Next.js</p>
    </div>
  );

  export default Index;
